var Minimatch=require("../minimatch.js").Minimatch;var tap=require("tap");tap.test("cache test",function(d){var b=new Minimatch("a?b");var c=new Minimatch("a?b");d.equal(b,c,"should get the same object");for(var a=0;a<100;a++){new Minimatch("a"+a)}c=new Minimatch("a?b");d.notEqual(b,c,"cache should have dropped");d.end()});